  [],\n\t\"revision_timestamp\": \"2015-07-23T03:28:32.653582\",\n\t\"name\": \"integrated-pest-management-plan-shiawassee-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of any Integrated Pest Management
  Plan must ensure the primary goals of Shiawassee NWR are met while using the best
  techniques to minimize pest impacts on management programs. Most importantly, the
  goals of the Refuge and management programs must be reached in the most environmentally
  sound fashion. The objectives of the IPM are to ensure that pest impacts do not
  result in failure to meet program goals, ensure active management in initiated only
  when the pest has reached a threshold or problem level, ensure the management technique
  chosen to combat each pest problem is the best choice, ensure that the technique
  chosen to control a pest is applied only to impact areas, and ensure a blending
  of management activities and IPM techniques that will optimize the habitat potential.\",\n\t\"license_title\":
